import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <body>
          <header className="header">
            <nav className="nav-primary">
                <ul>
                  <li className="nav-links" onClick={this.clickHandler}><a href="#">Register</a></li>
                  <li className="nav-links"><a href="#">Login</a></li>
                </ul>
            </nav>
            <h1 className="App-Name">SCANAPE</h1>
            <h5 className="App-Sub-Name">You Know The Deal Just Scan And You've Got A Meal</h5>
          </header>
      </body>
    );
  }
}

export default App;
